import { Component } from "react";
import "./item.css"
import "./cart.jpeg";


class Item extends Component {
    render() {
        return (
            <div className="item-container">
                <img className="item-image"
                    srcSet="./cart.jpg"></img>
                <div className="button-container ">
                    <img className="icon-size" src="https://img.favpng.com/12/18/15/shopping-cart-icon-png-favpng-e5DiMUYLNYaTjdsibphFUCAxC.jpg"></img>
                </div>
            </div>
        );
    }
}
export default Item;
